from datetime import datetime, timedelta
from airflow import DAG
from airflow.operators.docker_plugin import DockerWithVariablesOperator
from airflow.utils.weight_rule import WeightRule

default_args = {
    'owner': 'airflow',
    'depends_on_past': False,
    'start_date': datetime(2018, 5, 29),
    'cactchup_by_default': False,
    'retries': 100,
    'retry_delay': timedelta(seconds=2),
    'retry_exponential_backoff': True,
    }
dag = DAG(
    "pinky40_new_alignment_agg", default_args=default_args, schedule_interval=None)

ws_image = "ranlu/watershed:ranl_pinky40"
agg_image = "ranlu/agglomeration:ranl_pinky40"

def atomic_chunks_op(dag, tags):
    cmdlist = " && ".join(["/root/agg/scripts/atomic_chunk_me.sh {}.json".format(tag) for tag in tags])
    return DockerWithVariablesOperator(
        ['google-secret.json', 'config.sh'],
        host_args={'shm_size': '8G'},
        mount_point='/root/.cloudvolume/secrets/',
        task_id='atomic_chunk_' + tags[0],
        command='/bin/bash -c "cp /root/agg/test/*.json $AIRFLOW_TMP_DIR && cd $AIRFLOW_TMP_DIR && {} && rm -rf $AIRFLOW_TMP_DIR/*"'.format(cmdlist),
        default_args=default_args,
        image=agg_image,
        weight_rule=WeightRule.ABSOLUTE,
        execution_timeout=timedelta(minutes=20),
        queue="atomic",
        dag=dag
    )

